import React from 'react'
import { Link } from "react-router-dom";

// Placeholder Modelviewer Eames Chair DSW

class PlaceholderAR extends React.Component {


    render() {
        return (
            <div className="PlaceholderAR">
                <a href="https://apps.8thwall.com/ahyiquuj/ARCam2/">
                    <img src="/media/Placeholder.png" alt="AR" width="100%" height="auto" />
                </a>
            </div>
        )
    }
}

export default PlaceholderAR;
